import os
import sys

sys.path.append(os.path.dirname(os.getcwd()))

from BA1B.BA1B_solution import naive_frequent_kmer


def find_clumps(genome: str, k: int, L: int, t: int) -> {str}:
    """
    Given integers length and t, a string forms an (L, t) clump inside the larger string genome if there is an interval
    of genome of length L which the pattern appears atleast t times.
    :param genome: full sequence to search
    :param k: length of kmer
    :param L: size of interval to search
    :param t: number of times the pattern should appear
    :return:
    """

    results = []
    genome_length = len(genome)
    window_start = 0

    # create windows of size L
    while (window_start + L) <= genome_length:

        window = genome[window_start:(window_start + L)]

        # look for kmers of size k within each window
        window_results = naive_frequent_kmer(window, k)

        # only take those kmers which are of count t or greater
        results += [kmer.sequence for kmer in window_results if kmer.count >= t]

        window_start += 1

    return set(results)


case_one_results = find_clumps('GATCAGCATAAGGGTCCCTGCAATGCATGACAAGCCTGCAGTTGTTTTAC',
                               4, 25, 3)

assert len(case_one_results) == 1
assert 'TGCA' in case_one_results

case_two_results = find_clumps('CGGACTCGACAGATGTGAAGAAATGTGAAGACTGAGTGAAGAGAAGAGGAAACACGACACGACATTGCGACATAATGTACGAATGTAATGTGCCTATGGC',
                               5, 75, 4)

assert len(case_two_results) == 3

assert 'CGACA' in case_two_results
assert 'GAAGA' in case_two_results
assert 'AATGT' in case_two_results

case_three_results = find_clumps('',
                                 11, 566, 18)

assert len(case_three_results) == 1

assert 'AAACCAGGTGG' in case_three_results


case_four_results = find_clumps('',
                                9, 518, 16)

assert len(case_four_results) == 8

assert 'TATGACTAG' in case_four_results
assert 'TTGTGATCT' in case_four_results
assert 'ACATATTGA' in case_four_results
assert 'CTCGGTGTA' in case_four_results
assert 'CTGTACACA' in case_four_results
assert 'ATAATCTGA' in case_four_results
assert 'AGCGGCTGT' in case_four_results
assert 'GACCAAGCC' in case_four_results
